import React from 'react'
import styled from 'styled-components'

const Container=styled.div`
display: flex;
flex-direction: column;
align-items: center;
padding: 0px 0px 64px;
gap: 96px;
position: absolute;
width: 1512px;
height: 1167.5px;
left: 0px;
top: 120px;
`
const Top=styled.div`
width: 1512px;
height: 795.5px;
background: #061237;
flex: none;
order: 0;
flex-grow: 0;
`

const Bottom=styled.div`
width: 1120px;
height: 212px;
flex: none;
order: 1;
flex-grow: 0;
`
const Main=styled.div``
const BottomDiv=styled.div``
const Div1=styled.div``
const Div2=styled.div``
const TopDiv=styled.div``
const Intro = () => {
  return (
    <Container>
      <Top>
        <TopDiv></TopDiv>
        <Main></Main>
        <Div1></Div1>
        <Div2></Div2>
        <Vector></Vector>
        <BottomDiv></BottomDiv>
      </Top>
      <Bottom>

      </Bottom>
    </Container>
  )
}

export default Intro
